const Header = ({title}) => {
  return (
    <header>
      <h1> {title} </h1>
    </header>
  )}

export default Header

Header.defaultProps = {
    title: 'Task Tracker'
}

Header.propTypes = {
    title: PropTypes.string.isRequired
}
